/* Clear screen with black color */
void clear_screen()
{
    // Traverse through entire screen
    for (int y = 0; y < 240; ++y)
    {
        for (int x = 0; x < 320; ++x)
        {
            // Draw black color
            plot_pixel(x, y, 0x0);
        }
    }
}



/* Clear screen with empty character buffer */
void clear_character(){
    // Traverse through entire screen
    for (int y = 0; y < 60; ++y){
        for (int x = 0; x < 80; ++x){
            plot_character(x, y, 0x0);
        }
    }
}


/* Draw title screen */
void draw_title_screen(){
    // Local Variable Declaration
    int x = 0, y = 0;

    // Traverse through all pixels
    for (int i = 0; i < 320 * 2 * 240 - 1; i += 2) {
        short int color = (title_image[i] << 8) | title_image[i+1];

        plot_pixel(x, y, color);
        x++;
        
        // Check if end of row is reached
        if (x == 320) {
            x = 0;
            y += 1;
        }
    }
    
    draw_title_message();
}


