/* Setting front and back buffer */
void set_front_back_buffer(){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;

    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen();
}


/* Plot pixel at a location with given color */
void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}


/* Plot character at a location with given ASCII code */
void plot_character(int x, int y, int character){
    *(char *)(character_buffer_start + (y << 7) + x) = character;
}


/* Waiting function for vertical sync */
void wait_for_vsync()
{
    // Local Variable Declaration
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    register int status;
    
    // Start synchronization
    *pixel_ctrl_ptr = 1;
    
    // Wait until S bit in status register is 0
    status = *(pixel_ctrl_ptr + 3);
    while ((status & 0x01) != 0)
    {
        status = *(pixel_ctrl_ptr + 3);
    }
    
    // Update back buffer after swap
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    isBackBufferSDRAM = !isBackBufferSDRAM;
}


/* Draw line with given coordinates and colours */
void draw_line(int x_start, int y_start, int x_end, int y_end, short int color)
{
    
    // Determine steepness
    bool is_steep = abs(y_end - y_start) > abs(x_end - x_start);
    
    // Determine if line is directed down/up
    if (is_steep)
    {
        swap(&x_start, &y_start);
        swap(&x_end, &y_end);
    }
    
    // Determine if line is directed to left/right 
    if (x_start > x_end)
    {
        swap(&x_start, &x_end);
        swap(&y_start, &y_end);
    }
    
    // Local Variable Declaration
    int delta_x = x_end - x_start;
    int delta_y = abs(y_end - y_start);
    int error = (-1) * (delta_x / 2);
    int y = y_start;
    int y_step;
    
    // Determine incrementing value of y
    if (y_start < y_end)
    {
        y_step = 1;
    }
    else
    {
        y_step = -1;
    }
    
    // Traverse in the x direction
    for (int x = x_start; x <= x_end; ++x)\
    {
        // Plot color according to steepness
        if (is_steep)
        {
            plot_pixel(y, x, color);
        }
        else
        {
            plot_pixel(x, y, color);
        }
        
        // Update error
        error += delta_y;
        
        // Determine if y should be incremented
        if (error >= 0)
        {
            y  += y_step;
            error -= delta_x;
        }
    }
}


/* Swap values of two integers */
void swap(int *value1, int *value2)
{
    int temp = *value1;
    *value1 = *value2;
    *value2 = temp;
}
